Eigen::Matrix4d Matrix_reshape(Eigen::Matrix<double,9,1> a)
{
    Eigen::Matrix4d EE;

    EE<<0,0,0,0,
        0,a(0),a(3),a(6),
        0,a(1),a(4),a(7),
        0,a(2),a(5),a(8);
    return EE;
}
